// Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = () => {
  const [loansSummary, setLoansSummary] = useState({});
  const [recentPayments, setRecentPayments] = useState([]);
  const [users, setUsers] = useState([]);

  useEffect(() => {
    // Obtener resumen de préstamos
    const fetchLoansSummary = async () => {
      try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/loans/summary`);
        setLoansSummary(response.data);
      } catch (error) {
        console.error('Error al obtener el resumen de préstamos:', error);
      }
    };

    // Obtener pagos recientes
    const fetchRecentPayments = async () => {
      try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/payments/recent`);
        setRecentPayments(response.data);
      } catch (error) {
        console.error('Error al obtener los pagos recientes:', error);
      }
    };

    // Obtener usuarios registrados
    const fetchUsers = async () => {
      try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}/users`);
        setUsers(response.data);
      } catch (error) {
        console.error('Error al obtener los usuarios registrados:', error);
      }
    };

    fetchLoansSummary();
    fetchRecentPayments();
    fetchUsers();
  }, []);

  return (
    <div className="container mt-5">
      <h1>Dashboard</h1>
      <div className="row">
        <div className="col-md-4">
          <div className="card text-white bg-primary mb-3">
            <div className="card-header">Préstamos Totales</div>
            <div className="card-body">
              <h5 className="card-title">{loansSummary.totalLoans}</h5>
              <p className="card-text">Cantidad total de préstamos registrados.</p>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card text-white bg-success mb-3">
            <div className="card-header">Monto Total Prestado</div>
            <div className="card-body">
              <h5 className="card-title">${loansSummary.totalAmount}</h5>
              <p className="card-text">Cantidad total de dinero prestado.</p>
            </div>
          </div>
        </div>
        <div className="col-md-4">
          <div className="card text-white bg-warning mb-3">
            <div className="card-header">Usuarios Registrados</div>
            <div className="card-body">
              <h5 className="card-title">{users.length}</h5>
              <p className="card-text">Cantidad total de usuarios registrados.</p>
            </div>
          </div>
        </div>
      </div>

      <h2 className="mt-4">Pagos Recientes</h2>
      <table className="table table-striped">
        <thead>
          <tr>
            <th>ID del Préstamo</th>
            <th>Cantidad Pagada</th>
            <th>Fecha de Pago</th>
          </tr>
        </thead>
        <tbody>
          {recentPayments.map((payment) => (
            <tr key={payment.id}>
              <td>{payment.loanId}</td>
              <td>${payment.amount}</td>
              <td>{new Date(payment.date).toLocaleDateString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
